// src/pages/Dashboard.jsx
import React, { useEffect, useMemo, useState } from 'react';
import { eventAPI } from '../api';
import LoadingState from '../components/LoadingState';
import MemberProfileCard from '../components/MemberProfileCard';
import MemberJourney from '../components/MemberJourney';

export default function Dashboard() {
  const [journey, setJourney] = useState([]);
  const [metrics, setMetrics] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError]     = useState('');

  useEffect(() => {
    let mounted = true;

    Promise.all([
      eventAPI.getJourney().catch(e => { throw { key: 'journey', error: e }; }),
      eventAPI.getMetrics().catch(e => { throw { key: 'metrics', error: e }; }),
    ])
      .then(([jRes, mRes]) => {
        if (!mounted) return;
        const jData = Array.isArray(jRes?.data) ? jRes.data : [];
        const mData = mRes?.data || null;
        setJourney(jData);
        setMetrics(mData);
      })
      .catch((e) => {
        console.error(e);
        if (!mounted) return;
        setError('Failed to load dashboard data');
      })
      .finally(() => mounted && setLoading(false));

    return () => { mounted = false; };
  }, []);

  const computed = useMemo(() => {
    const totalEpisodes = journey.length;
    const totalMessages = journey.reduce((acc, ep) => acc + (ep?.metrics?.messages || 0), 0);
    const totalDecisions = journey.reduce((acc, ep) => acc + (ep?.metrics?.decisions || 0), 0);
    return { totalEpisodes, totalMessages, totalDecisions };
  }, [journey]);

  if (loading) return <LoadingState label="Loading dashboard..." />;
  if (error)   return <div style={{ color: 'crimson' }}>{error}</div>;

  return (
    <div style={{ maxWidth: 1100, margin: '0 auto', padding: 16, display: 'grid', gap: 16 }}>
      {/* Header */}
      <div style={{ display: 'grid', gap: 8 }}>
        <h1 style={{ margin: 0 }}>Elyx Member Dashboard</h1>
        <div style={{ color: '#666' }}>
          Quick read on the member’s journey, profile, and action flow.
        </div>
      </div>

      {/* Top Stats */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gap: 12
      }}>
        <BigStat title="Episodes" value={computed.totalEpisodes} />
        <BigStat title="Messages" value={computed.totalMessages} />
        <BigStat title="Decisions" value={computed.totalDecisions} />
      </div>

      {/* Content grid */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: '1fr 2fr',
        gap: 16
      }}>
        <div style={{ display: 'grid', gap: 16 }}>
          <MemberProfileCard />
          {/* If your /metrics returns something meaningful, render it here */}
          <MetricsCard metrics={metrics} />
        </div>
        <div>
          <MemberJourney />
        </div>
      </div>
    </div>
  );
}

function BigStat({ title, value }) {
  return (
    <div style={{
      background: 'white',
      border: '1px solid #eee',
      borderRadius: 12,
      padding: 16,
      textAlign: 'center'
    }}>
      <div style={{ fontSize: 12, color: '#666' }}>{title}</div>
      <div style={{ fontSize: 28, fontWeight: 800 }}>{value}</div>
    </div>
  );
}

function MetricsCard({ metrics }) {
  if (!metrics || typeof metrics !== 'object') {
    return (
      <div style={{
        background: 'white',
        border: '1px solid #eee',
        borderRadius: 12,
        padding: 16
      }}>
        <div style={{ fontSize: 14, color: '#666' }}>No additional metrics.</div>
      </div>
    );
  }

  // Render shallow key-value metrics defensively
  const entries = Object.entries(metrics || {});
  return (
    <div style={{
      background: 'white',
      border: '1px solid #eee',
      borderRadius: 12,
      padding: 16,
      display: 'grid',
      gap: 8
    }}>
      <h3 style={{ margin: 0 }}>Metrics</h3>
      <div style={{ display: 'grid', gap: 6 }}>
        {entries.map(([k, v]) => (
          <div key={k} style={{ display: 'flex', justifyContent: 'space-between', gap: 8 }}>
            <span style={{ color: '#666' }}>{k}</span>
            <strong>{typeof v === 'object' ? JSON.stringify(v) : String(v)}</strong>
          </div>
        ))}
      </div>
    </div>
  );
}
